Mykolaiv Raion (Ukrainian: Миколаївський район) was a raion (district) in Lviv Oblast in western Ukraine. Its administrative center was Mykolaiv. The raion was abolished on 18 July 2020 as part of the administrative reform of Ukraine, which reduced the number of raions of Lviv Oblast to seven. The area of Mykolaiv Raion was merged into Stryi Raion. The last estimate of the raion population was 62,537 (2020 est.).It was established in 1939.
At the time of disestablishment, the raion consisted of three hromadas:
Mykolaiv urban hromada with the administration in Mykolaiv;
Rozvadiv rural hromada with the administration in the selo of Rozvadiv;
Trostianets rural hromada with the administration in the selo of Trostianets.

Vovchansk Raion (Ukrainian: Вовчанський район) was a raion (district) in Kharkiv Oblast of Ukraine. Its administrative center was the town of Vovchansk. The raion was abolished on 18 July 2020 as part of the administrative reform of Ukraine, which reduced the number of raions of Kharkiv Oblast to seven. The area of Vovchansk Raion was, together with Pechenihy and Zmiiv Raions, merged into Chuhuiv Raion. The last estimate of the raion population was 44,448 (2020 est.)At the time of disestablishment, the raion consisted of two hromada:
Staryi Saltiv settlement hromada with the administration in the urban-type settlement of Staryi Saltiv;
Vovchansk urban hromada with the administration in Vovchansk.

Dolyna Raion (Ukrainian: Доли́нський райо́н, romanized: Dolynśkyi rajon) was a raion (administrative district) of Ivano-Frankivsk Oblast of Ukraine. The city of Dolyna was the administrative center of the raion. The raion was abolished on 18 July 2020 as part of the administrative reform of Ukraine, which reduced the number of raions of Ivano-Frankivsk Oblast Oblast to six. The area of Dolyna Raion was merged into Kalush Raion. The last estimate of the raion population was 68,266 (2020 est.).
The raion was located in the historical land of Boyko people.
At the time of disestablishment, the raion consisted of three hromadas:
Dolyna urban hromada with the administration in Dolyna;
Vyhoda settlement hromada with the administration in the urban-type settlement of Vyhoda;
Vytvytsia rural hromada with the administration in the selo of Vytvytsia.
